export default function JoinCommunity() {
    return (
        <div className="join-community__container">
            <h1 className="join-community__title">Join our community</h1>
            <p className="join-community__subtitle">30-day, hassle-free money back guarantee</p>
            <p className="join-community__description">
                Gain access to our full library of tutorials along with expert code reviews.
                Perfect for any developers who are serious about honing their skills.
            </p>
        </div>
    )
}
